// src/components/BlogPosts/BlogPosts.tsx
import React, { Suspense } from 'react';
import { Link } from 'react-router-dom';
import { allBlogComponents } from '../../blogContent/BlogUtils';
import './BlogPosts.css';

function BlogPosts() {
    return (
        <div>
            <h2>Blog Posts</h2>
            <Suspense fallback={<div>Loading...</div>}>
                {Object.keys(allBlogComponents).map((componentName) => {
                    const path = `/blog/${componentName}`;

                    return (
                        <div key={componentName}>
                            <h3>
                                <Link to={path}>{componentName}</Link>
                            </h3>
                            <hr />
                        </div>
                    );
                })}
            </Suspense>
        </div>
    );
}

export default BlogPosts;
